Pseudocode for Problem 1:
```
FUNCTION fizz_buzz(integer_n)
    DEFINE FUNCTION gather_divisible(index, collected)
        IF index >= integer_n THEN
            RETURN collected
        ELSE
            IF (index MOD 11 = 0) OR (index MOD 13 = 0) THEN
                RETURN gather_divisible(index + 1, collected + [index])
            ELSE
                RETURN gather_divisible(index + 1, collected)
            END IF
        END IF
    END FUNCTION

    LET filtered_values = gather_divisible(0, [])
    LET combined_text = ""
    LET pos = 0

    WHILE pos < LENGTH(filtered_values)
        combined_text = combined_text + STRING(filtered_values[pos])

Modified Pseudocode for Problem 1:
```
FUNCTION fizz_buzz(integer_n)
    SET list_of_numbers TO empty list
    FOR each integer_i IN range FROM 0 TO integer_n EXCLUSIVE
        IF integer_i MODULO 11 EQUALS 0 OR integer_i MODULO 13 EQUALS 0
            APPEND integer_i TO list_of_numbers
        END IF
    END FOR
    SET concatenated_string TO empty string
    FOR each number IN list_of_numbers
        CONCATENATE string representation of number TO concatenated_string
    END FOR
    SET count_of_sevens TO 0
    FOR each character_c IN concatenated_string
        INCREMENT count_of_sevens BY (character_c EQUALS '7')
    END FOR
    RETURN count_of_sevens
END FUNCTION
```

